import React, { useState } from 'react';
import { Link, useNavigate, useParams } from 'react-router-dom';
import { Plus, Search, ChevronLeft } from 'lucide-react';

export const AnatomicalLocations = () => {
  const { systemId } = useParams();
  const navigate = useNavigate();
  const [locations] = useState([
    { id: 'epaule', name: 'Épaule' },
    { id: 'coude', name: 'Coude' },
    { id: 'poignet', name: 'Poignet' },
    { id: 'rachis', name: 'Rachis' },
    { id: 'hanche', name: 'Hanche' },
    { id: 'genou', name: 'Genou' },
    { id: 'cheville', name: 'Cheville' },
    { id: 'pied', name: 'Pied' },
  ]);

  return (
    <div>
      <div className="bg-[#4f5b93] text-white p-4 flex items-center">
        <button onClick={() => navigate('/')} className="mr-4">
          <ChevronLeft size={24} />
        </button>
        <h1 className="text-xl font-semibold">Localisations anatomiques</h1>
      </div>

      <div className="p-4">
        <div className="relative mb-4">
          <Search className="absolute left-3 top-3 text-gray-400" size={20} />
          <input
            type="text"
            placeholder="Rechercher une localisation..."
            className="w-full p-2 pl-10 rounded-lg border border-gray-300"
          />
        </div>

        <div className="grid gap-4">
          {locations.map((location) => (
            <Link
              key={location.id}
              to={`/system/${systemId}/location/${location.id}`}
              className="block bg-white rounded-lg shadow p-4 hover:shadow-lg transition-shadow"
            >
              <h2 className="text-lg font-semibold text-[#4f5b93]">{location.name}</h2>
            </Link>
          ))}
        </div>
      </div>

      <button
        onClick={() => navigate('/add-folder/location')}
        className="fixed bottom-6 right-6 bg-[#4f5b93] text-white rounded-full p-4 shadow-lg hover:bg-[#3f4973] transition-colors"
      >
        <Plus size={24} />
      </button>
    </div>
  );
};
